			$rests[]= $rest;			
		}
	}else{
		return false;
	}
		
	 if($iscache){
if(file_put_contents($filecached, serialize($rests))){
	$brankas="OK";
}	 
	 }
	 return $rests;
}

	

function tiga_kata($str){
	$str= trim($str);
	$arr= array_filter(explode(" ", $str));
		if(count($arr) > 3){
			$str= $arr[0]." ".$arr[1]." ".$arr[2];
		}
	return $str;	
}	
	

	
function randomKeywords(){
$alltxt= glob("dankey/*.txt");
shuffle($alltxt);
$thistxt= $alltxt[0];

$allarray= file_get_contents($thistxt);
$allarray= array_filter(explode("\n", $allarray));
shuffle($allarray);
$data= array_slice($allarray,0,30);
$content='';
foreach($data as $items){
$items= trim($items);
$slugsq= trim(str_replace('/', '-', $items),'-');
$slugsq= trim(str_replace(' ', '-', $slugsq),'-');
$pathsq= substr(md5($slugsq),0,5);
$content .= '<a href="http://'.$_SERVER['SERVER_NAME'].'/'.$pathsq.'/'.$slugsq.'.pdf">'.$items.'</a> , ';
}
return $content;
}	
	

