function author_num($str){
	$str= $_SERVER['SERVER_NAME'].$str;
$sh= sha1($str);
$sh= preg_replace('/[^0-9]+/i', '', $sh);
$shnum= strlen($sh);
    if($shnum >= 2 && $shnum >= 4){
$sh= str_replace(0,1,$sh);		
$as= substr($sh,0,2); $bs= substr($sh,2,2);
    }else{
$strnum= strlen($str);        
$as= $strnum; $bs= ($strnum*2);
    }
$ar= array($as,$bs);
return $ar;
